import React from 'react';
import {Text, View, StyleSheet, ImageBackground, Image, TextInput, TouchableOpacity} from 'react-native';
import {PrimaryButton} from '../../components/button';
import COLORS from '../../components/color';
import {Row, Col} from 'antd';

const HeaderUser = () => {
    return (
        <View style={style.container}>
                <View style={style.content}>
                            <Image
                                style={{
                                    width: 310,
                                    height: 60,
                                }}
                                source={require('../../logo.png')}
                            />
                            <View style={style.box}>
                                <Text style={{ fontSize: 32, fontWeight: 'bold', textAlign: 'center'}}>
                                    SIGN UP
                                </Text>
                            <View style={style.formLogin}>
                                <View style={style.inputContainer}>
                                    <TextInput
                                        style={{ paddingLeft: 10, flex: 2, fontSize: 16, color: COLORS.grey }}
                                        placeholder="Full Name"
                                    />
                                    </View>
                                    <View style={style.inputContainer}>
                                    <TextInput
                                        style={{ paddingLeft: 10, flex: 2, fontSize: 16 }}
                                        placeholder="Email"
                                    />
                                    </View>
                                    <View style={style.inputContainer}>
                                    <TextInput
                                        style={{ paddingLeft: 10, flex: 2, fontSize: 16 }}
                                        placeholder="Telephone"
                                    />
                                    </View>
                                    <View style={style.inputContainer}>
                                    <TextInput
                                        style={{ paddingLeft: 10, flex: 2, fontSize: 16 }}
                                        placeholder="Password"
                                    />
                                    </View>
                                    <PrimaryButton
                                    onPress={() => navigation.navigate('Home')}
                                    title="Next"
                                    />
                            <Text
                                style={{
                                    marginTop: 20,
                                    fontSize: 16,
                                    textAlign: 'center',
                                    color: COLORS.grey,
                                }}>
                                Already have an Account? <TouchableOpacity activeOpacity={0.5} onPress={() => navigation.navigate('SignIn')}><Text style={{ color: COLORS.primary, fontWeight: 'bold', fontSize: 18 }}>Sign In</Text></TouchableOpacity>
                            </Text>
                            </View>
                        </View>
            </View>
    </View>
    );
};

const style = StyleSheet.create({
    container: {
        flex: 1,
        height: '100%',
    },
    image: {
        flex: 1,
        resizeMode: "cover",
        justifyContent: "left"
    },
    content: {
        flex: 1,
        justifyContent: "center",
        flexDirection: 'column'
    },
    textContainer: {
        flex: 1,
        paddingHorizontal: 20,
        justifyContent: 'space-between',
      },
      inputContainer: {
        height: 50,
        width: 290,
        marginBottom: 20,
        borderRadius: 15,
        backgroundColor: COLORS.white,
        shadowRadius: 20,
        elevation: 13,
        shadowColor: COLORS.grey,
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
      },
      box: {
        height: 500,
        width: 350,
        marginTop: 20,
        padding: 20,
        borderRadius: 15,
        backgroundColor: COLORS.white,
        shadowRadius: 10,
        elevation: 13,
        shadowColor: COLORS.grey,
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'space-between',
      }
});

export default HeaderUser;
